ExportResources.description:
Багато деймоських риб виділяють реагенти в мішкоподібному органі, створюючи леткі гази, які дозволяють деякий час левітувати.

Гарантовано можна зібрати з:
— остиміра;
— аквапульми;
— вітреоспіни;
— криптозукта;
— барбісти;
— кимера;
— амніопсії;
— ґлютінокса.

Адаптовані мембрани, які дозволяють багатьом деймоським рибам вільно пересуватися як рідинними, так і газовими середовищами.

Гарантовано можна зібрати з:
— остиміра;
— аквапульми;
— вітреоспіни;
— миксостомати;
— дюроїда.

Це поліпшення інкубатора:

— додає можливість обернути дорослішання тварин у зворотний бік;
— зменшує на день тривалість інкубації яйця.
